import React from 'react';

const Stock = () => {
    return (
        <div>
            <table className="pay-table">
        <thead>
          <tr>
            <th>NO</th>
            <th>지점명</th>
            <th>메뉴명</th>
            <th>이미지파일주소</th>
            <th>재고량</th>
            <th>상품상태</th>
            <th>발주상태</th>
            <th>발주하기</th>
          </tr>
        </thead>
        <tbody>
          
        </tbody>
      </table>
        </div>
    );
};

export default Stock;
